Node.js > 'findOne' of undefined < LocalStrategy from Passport<p>I used Passport to create login.</p>

<p>However, I get:</p>

<blockquote>
  <p>TypeError: Cannot read property 'findOne' of undefined</p>
</blockquote>

<p>when trying to login.</p>

<p>After debugging, I confirmed that user was undefined after async of <code>localStrategy.js</code>.</p>

<p>I think all the actions are perfect, but there is a problem with my code. </p>

<p>Can I tell you where I made the mistake?</p>

<p><strong>passport/index.js</strong></p>

<pre><code>const local = require('./localStrategy');
const { User } = require('../model/user');

module.exports = (passport) =&gt; {
  passport.serializeUser((user, done) =&gt; {
    done(null, user._id);
  });

  passport.deserializeUser((id, done) =&gt; {
    User.findOne({ id: id })
      .then((user) =&gt; done(null, user))
      .catch((err) =&gt; done(err));
  });

  local(passport);
};
</code></pre>

<p><strong>passport/localStrategy.js</strong></p>

<pre><code>const LocalStrategy = require('passport-local').Strategy;
const { User } = require('../model/user');

module.exports = (passport) =&gt; {
  passport.use(
    new LocalStrategy(
      {
        usernameField: 'email',
        passwordField: 'password'
      },
      async (email, password, done) =&gt; {
        try {
          const exUser = await User.findOne({ email: email });
          if (exUser) {
            const result = await bcrypt.compare(password, exUser.password);
            if (result) {
              done(null, exUser);
            } else {
              done(null, false, { message: 'failed.' });
            }
          } else {
            done(null, false, { message: 'failed.' });
          }
        } catch (err) {
          console.error(err);
          done(err);
        }
      }
    )
  );
};
</code></pre>

<p><strong>routes/user.js</strong></p>

<pre><code>const express = require('express');
const router = express.Router();

const { isLoggedIn, isNotLoggedIn } = require('./middleware');

const usersController = require('../controller/users_controller');

router.get('/login', isNotLoggedIn, usersController.user_login);
</code></pre>

<p><strong>controller/users_controller.js</strong></p>

<pre><code>const User = require('../model/user');
const bcrypt = require('bcrypt');
const passport = require('passport');

exports.user_login = (req, res, next) =&gt; {
  passport.authenticate('local', (authError, user, info) =&gt; {
    if (authError) {
      console.error(authError);
      return next(authError);
    }
    if (!user) {
      return res.send("not user.")
    }
    return req.login(user, (loginError) =&gt; {
      if (loginError) {
        console.error(loginError);
        return next(loginError);
      }
      return res.send("login successfully")
    });
  })(req, res, next);
};
</code></pre>

<p><strong>model/user.js</strong></p>

<pre><code>const mongoose = require('mongoose');

let UserSchema = new mongoose.Schema({
  email: {
    type: String,
    required: true,
    unique: true
  },
  password: {
    type: String,
    require: true
  },
  createAt: {
    type: Date,
    default: Date.now
  }
});

module.exports = mongoose.model('User', UserSchema);
</code></pre>

