<p>I have tried adding a sort stage  between the two stages and seems to ignore it.  <code>{$sort:{'data.tod':-1}}</code>
I next tried a sort after the bucket <code>{$sort:{T:-1}}</code>, which also had no effect on the output.</p>

<pre><code>    let cursor = self.collection.aggregate([
        {
            $match: {
                type: 'image',
            }
        },{
            $bucket: {
                groupBy: '$data.tod',
                boundaries: boundsObj.array,
                default: 'ungrouped',
                output: {
                    'data': {$addToSet:{
                            T: '$data.tod',
                            SDN: '$data.shortDirName'
                            }
                        }
                    }
                }
        }],null);
</code></pre>

