Query for mongoRepository list<p>I have a MongoDB collection with documents with the following fields: </p>

<ul>
<li>date (Date obj) </li>
<li>offerType (str)</li>
</ul>

<p>I want to write a method with MongoRepository <strong>to find all the documents that has date in a range of dates and offerType contains one of the string provided in a list</strong>.<br></p>

<hr>

<h2>Example</h2>

<p>Documents:</p>

<ol>
<li>date: 10-04-2019, offerType: offer1</li>
<li>date: 11-04-2019, offerType: offer3</li>
<li>date: 15-04-2019, offerType: offer2</li>
<li>date: 15-04-2019, offerType: offer1</li>
</ol>

<p>I want:</p>

<ul>
<li>dates between 9-04-2019 and 12-04-2019</li>
<li>following offers: offer1, offer3</li>
</ul>

<p>In the previous example I would obtain documents 1 and 2. </p>

<hr>

<h2>My code</h2>

<p>I use MongoRepository and a custom Object which contains the fields I require:</p>

<pre><code>import java.util.Date;
import java.util.List;

import org.springframework.data.domain.Pageable;
import org.springframework.data.mongodb.repository.MongoRepository;     
public interface ReportVocalOrderRepository extends MongoRepository&lt;ReportVocalOrder, String&gt; {

    List&lt;ReportVocalOrder&gt; findByDateBetween(Date startDate, Date endDate, Pageable pageable);

    List&lt;ReportVocalOrder&gt; findByDateBetweenAndOfferTypeContaining(Date startDate, Date endDate, List&lt;String&gt; offers, Pageable pageable);


}
</code></pre>

<p>Here is the document class: </p>

<pre><code>@JsonInclude(Include.NON_NULL)
@Document(collection = Constants.Mongo.Collections.VOCAL_ORDER_REPORT)
@ApiModel
public class ReportVocalOrder {

    @Id
    private String id;

    private Date date;
private String offerType;
public Date getDate() {
        return date;
    }

    public void setDate(Date date) {
        this.date = date;
    }
public String getOfferType() {
        return offerType;
    }

    public void setOfferType(String offerType) {
        this.offerType = offerType;
    }
}
</code></pre>

<p>The first method of the MongoRepository works fine; the second one instead returns an empty list.<br>
The problem is <strong>to query the mongoRepository to search a field that can contain one of the values of the list passed as an argument</strong>.
<br>
What's wrong with this implementation? There's a better way to implement this query?</p>

