        "hashedPass": "testPass",
        "profile": {
            "lastName": "testLast",
            "firstName": "testFirst",
            "studentId": 12345678,
            "year": 2,
            "credits": 0
        }
    }
  */
  try {
    const sData = req.body;
    const newStudent = await studentData.create(sData.userName,
      sData.hashedPass, sData.profile.lastName, sData.profile.firstName,
      sData.profile.studentId, sData.profile.year, sData.profile.credits);
    res.status(200).json(newStudent);
  } catch (e) {
    console.log(e);
    res.status(400).json({ error: "post /students" });
  }
});
</code></pre>

<p>And this is the function to create a new student</p>

<pre><code>const mongoCollections = require("./mongoCollections");
const students = mongoCollections.students;
const uuid = require("node-uuid");

const create = async (user, pwd, last, first, studentId, year, credits) =&gt;{
    const studentCollection = await students();
    const id = uuid.v4();
    if (!user || typeof(user) !== "string") throw "You must provide a username";
    if (!pwd || typeof(pwd) !== "string") throw "You must provide a password";
    if (!last || typeof(last) !== "string") throw "You must provide a last name for your student";
    if (!first || typeof(first) !== "string") throw "You must provide a first name for your student";
    if (!studentId || typeof(studentId) !== "number") throw "You must provide a student ID";
    if (!year || typeof(year) !== "number") throw "You must provide a year";
    if(credits !== 0){
      if (!credits || typeof(credits) !== "number") throw "You must provide number of completed credits";
    }

    const newstudent = {
      _id: id,
      userName: user,
      hashedPass: pwd,
      profile: {
        _id: id,
        lastName: last,
        firstName: first,
        studentId: studentId,
        year: year,
        credits: credits,
        finishedCourses: [],
        currentCourses: [],
        holds: false
      }
    };

    const insertInfo = await studentCollection.insertOne(newstudent);
    if (insertInfo.insertedCount === 0) console.log("Could not add student");
    const newId = insertInfo.insertedId;

    const student = await get(newId);
    return student;
  };
</code></pre>

<p>This all works fine when I send the JSON via Postman or set sData = the object I want to pass. But I created a simple HTML page with forms to submit the data from the client, but when I submit the form something strange happens. It sends the object to the route and the route receives it properly, meaning if I console.log(sData) at that point it will print the information I gave it. But then it stops running at the line
<code>const studentCollection = await students();</code>
and seemingly runs the post route again, but this time with an empty object. At that point it continues and runs through the rest of the code, and finishes but still appears to add the correct data to the collection, but the browser changes to a blank page with the error "{"error":"post /students"}" from my route. This is the HTML I'm using.</p>

<pre><code>&lt;!DOCTYPE html&gt;
&lt;html lang="en"&gt;
  &lt;head&gt;
    &lt;meta charset="utf-8"&gt;
    &lt;title&gt;&lt;/title&gt;
