        axios.post('/students',
          {
            "userName": "testUser",
            "hashedPass": "tesPass",
            "profile": {
                "lastName": "testLast",
                "firstName": "testFirst",
                "studentId": 12345678,
                "year": 2,
                "credits": 0
            }
          }
        );
      }
    &lt;/script&gt;
  &lt;/head&gt;
  &lt;body&gt;
    &lt;form method="post" action="/students"&gt;
      &lt;button type="submit" onclick="submitform()"&gt;submit&lt;/button&gt;
    &lt;/form&gt;
    &lt;form method="get" action="/students"&gt;
      &lt;button type="submit" onclick="getForm()"&gt;submit&lt;/button&gt;
    &lt;/form&gt;
  &lt;/body&gt;
&lt;/html&gt;
</code></pre>

<p>If it helps, this is my index.js from /routes</p>

<pre><code>const studentRoutes = require("./students");
