I figured out that trying to post several times through the HTML form changes the issue slightly. It passes all of the data to the route, which creates a new student and runs all the code without issue. Then <em>after completion</em>, it seemingly runs again with an empty object, stopping when it reaches
<code>const studentCollection = await students();</code>
