MongoDB store and query price history<p>I'm working with a set of data which is a product catalog. There's only about 20k items, and price change occurs rarely. Maybe 100 updates per month, at most. </p>

<p>However, price change is the interesting thing in this case, and I want to track prices over long periods of time. </p>

<p>I'm trying to find the best way to store the price data in a way that makes it easy to query. </p>

<p>Currently it's stored in an array on the product document. Simply the price along with a timestamp. Given the small and fairly static set of data, how would you design the model?</p>

<p>Also, bonus question, what would a filter look like that could give a list of products where the current price is lower than the previous one? </p>

<p>Example data, simplified version of the model:</p>

<pre><code>// Match, current price is lower than previous price

db.TestC.insert({Name: "P1", CurrentPrice: 10.0,  PriceHistory: [{Price: 14.0, Timestamp: ISODate("2019-04-26T07:11:11.939Z")}, {Price: 12.0, Timestamp: ISODate("2019-04-27T07:11:11.939Z")}]})

// No match, price history doesn't exist yet

db.TestC.insert({Name: "P2", CurrentPrice: 10.0, PriceHistory: null})

// No match, previous price was lower than current price

db.TestC.insert({Name: "P3", CurrentPrice: 18.0, PriceHistory: [{Price: 14.0, Timestamp: ISODate("2019-04-26T07:11:11.939Z")}, {Price: 12.0, Timestamp: ISODate("2019-04-27T07:11:11.939Z")}]})
</code></pre>

<p>Edit after some more work on this: </p>

<p>So, I finally came up with exactly what I needed and thought I should share in case it helps someone:</p>

<pre><code>db.TestCollection.aggregate({
    '$project': {
      'Number': 1, 
      'AssortmentKey': 1, 
      'AssortmentName': 1, 
      'NameExtension': 1, 
      'Name': 1, 
      'CurrentPrice': {
        '$arrayElemAt': [
          '$PriceHistory', -1
        ]
      }, 
      'PreviousPrice': {
        '$arrayElemAt': [
          '$PriceHistory', -2
        ]
      }
    }
  }, {
    '$match': {
      '$expr': {
        '$lt': [
          '$CurrentPrice.Price', '$PreviousPrice.Price'
        ]
      }
    }
  })
</code></pre>

